	public int lengthOfLongestSubstring(String s) {
		byte[] bytes = s.getBytes();
		Set<Byte> set = new HashSet<Byte>();
		int tmpMaxLength = 1;
		int maxLength = 0;
		for (int i = 0; i < bytes.length; i++) {
			set.add(bytes[i]);
			for (int j = i + 1; j < bytes.length; j++) {
				if (!set.contains(bytes[j])) {
					set.add(bytes[j]);
					tmpMaxLength ++;
				} else {
					set.clear();
					break;
				}
			}
			if (maxLength < tmpMaxLength) {
				maxLength = tmpMaxLength;
			}
			//如果不加这条判断条件则会出现：Time Limit Exceeded
			if (maxLength+i == bytes.length) {
				break;
			}
			tmpMaxLength = 1;
		}
		return maxLength;
	}
